import heapq

def has_close_elements(numbers: List[float], threshold: float) -> bool:
    numbers.sort()
    heap = []
    for i, num in enumerate(numbers):
        while heap and numbers[i] - heap[0][0] >= threshold:
            heapq.heappop(heap)
        if heap and abs(numbers[i] - heap[0][0]) < threshold:
            return True
        heapq.heappush(heap, (num, i))
    return False

